import React, { useState } from 'react';
import { View, StyleSheet, Text, Dimensions, Image, TouchableWithoutFeedback } from 'react-native';
import Swiper from 'react-native-deck-swiper';

//Get the Window's width and height
const { height, width } = Dimensions.get( 'window' );

//Sample card data
const cardData = [
  { id: 1, color: 'lightgrey', images: [require('./images/TerryCrews1.jpg'), require('./images/TerryCrews2.jpg')]},
  { id: 11, color: 'lightblue', images: [require('./images/Khabib1.jpg'), require('./images/Khabib2.webp')]},
];

//main app component
const App = () => {
  const [currentImages, setCurrentImages] = useState(cardData.reduce((acc, card) => {
    acc[card.id] = 0;
    return acc;
  }, {}));

  const handleImageTap = (cardID) => {
    setCurrentImages(prevImages => {
      const newImages = { ...prevImages };
      const card = cardData.find(card => card.id === cardID);
      const imageCount = card.images.length;
      newImages[cardID] = (newImages[cardID] + 1) % imageCount;
      return newImages;
    });
  };

  const handleSwipeBottom = () => {
    console.log('Swiped Down!');
    // Handle actions when swiped left
  };

  const handleSwipeTop = () => {
    console.log('Swiped Up!');
    // Handle actions when swiped right
  };
console.log(currentImages);

  // Component's rendering
  return (
    <View style={styles.container}>
      <Swiper
        cardHorizontalMargin={0}
        cardVerticalMargin={0}
        verticalSwipe={true}
        cards={cardData}
        renderCard={(card) => {
          const currentImageIndex = currentImages[card.id];
          const currentImage = card.images[currentImageIndex];

          return (
            <TouchableOpacity 
              key={card.id} 
              style={{ ...styles.card, backgroundColor: card.color }} 
              onPress={() => handleImageTap(card.id)}
            >
              <Image source={currentImage} style={styles.cardImage}/>
              <Text style={styles.text}>{card.color}</Text>
            </TouchableOpacity>
          );
        }}
        onSwipedBottom={handleSwipeBottom}
        onSwipedTop={handleSwipeTop}
        backgroundColor='#F5F5F5'
        cardIndex={0}
        infinite={true} // for making it loop (1st card will appear after last card is swiped)
        stackSize={3}
        stackSeparation={height * 0.03}
        animateCardOpacity
        animateOverlayLabelsOpacity
        overlayLabels={{
          bottom: {
            title: '✖',
            style: {
              label: {
                backgroundColor: 'red',
                borderRadius: width * 0.5,
                height: height * 0.1,
                width: height * 0.1,
                textAlign: 'center',
                color: '#fff',
              },
              wrapper: {
                flexDirection: 'column',
                alignItems: 'flex-end',
                justifyContent: 'flex-start',
                marginTop: height * 0.05,
                marginLeft: -height * 0.05
              }
            }
          },
          top: {
            title: '✔',
            style: {
              label: {
                backgroundColor: 'green',
                borderRadius: width * 0.5,
                height: height * 0.1,
                width: height * 0.1,
                textAlign: 'center',
                color: '#fff',
              },
              wrapper: {
                flexDirection: 'column',
                alignItems: 'flex-start',
                justifyContent: 'flex-start',
                marginTop: height * 0.05,
                marginLeft: height * 0.05
              }
            }
          },
        }}
      />
    </View>
  );
};

// Styles for the app
const styles = StyleSheet.create({
  container: {
    flex: 1
  },
  card: {
    alignSelf: 'center',
    width: width * 0.95,
    height: height * 0.99,
    borderRadius: 10,
    borderWidth: 0.5,
    borderColor: '#000',
    justifyContent: 'center',
    alignItems: 'center',
  },
  text: {
    textAlign: 'center',
    fontSize: 16,
    fontWeight: 'bold',
    color: '#000',
    backgroundColor: '#fff'
  },
  cardImage: {
    width: '100%',
    height: '80%',
    resizeMode: 'cover',
  },
});

// Export app component
export default App;
